3b\u044e\u0447\u0435\u043d\u0438\u044f \u0438 \u0433\u043e\u0434\u0430, \u043f\u0440\u043e\u0432\u0435\u0434\u0451\u043d\u043d\u043e\u0433\u043e \u0432 \u0441\u0443\u043c\u0430\u0441\u0448\u0435\u0434\u0448\u0435\u043c \u0434\u043e\u043c\u0435, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA%D0%B8%D0%B7_%D0%B4%D0%B5_%D0%A1%D0%B0%D0%B4\" title=\"\u041c\u0430\u0440\u043a\u0438\u0437 \u0434\u0435 \u0421\u0430\u0434\">\u043c\u0430\u0440\u043a\u0438\u0437 \u0434\u0435 \u0421\u0430\u0434<\/a> \u0431\u044b\u043b \u0432\u044b\u043f\u0443\u0449\u0435\u043d \u043d\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u0443. \u0427\u0435\u0440\u0435\u0437 11 \u043b\u0435\u0442 \u0435\u0433\u043e \u0441\u043d\u043e\u0432\u0430 \u0430\u0440\u0435\u0441\u0442\u0443\u044e\u0442 \u0438 \u043f\u043e\u043c\u0435\u0441\u0442\u044f\u0442 \u0432 \u0442\u043e\u0442 \u0436\u0435 \u0441\u0443\u043c\u0430\u0441\u0448\u0435\u0434\u0448\u0438\u0439 \u0434\u043e\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0441\u0442\u0430\u043d\u0435\u0442 \u0435\u0433\u043e \u043f\u0440\u0438\u0441\u0442\u0430\u043d\u0438\u0449\u0435\u043c \u0434\u043e \u043a\u043e\u043d\u0446\u0430 \u0436\u0438\u0437\u043d\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1792_%D0%B3%D0%BE%D0%B4\" title=\"1792 \u0433\u043e\u0434\">1792<\/a>&#160;\u2014 \u0423\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B5%D1%82%D0%B0\" title=\"\u041c\u043e\u043d\u0435\u0442\u0430\">\u043c\u043e\u043d\u0435\u0442\u043d\u044b\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%BC%D0%B8%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D1%81%D1%82%D0%BE%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u041d\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c\">\u043d\u043e\u043c\u0438\u043d\u0430\u043b\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D1%8C%D0%B3%D0%B8\" title=\"\u0414\u0435\u043d\u044c\u0433\u0438\">\u0434\u0435\u043d\u0435\u0436\u043d\u043e\u0439<\/a> \u0441\u0438\u0441\u0442\u0435\u043c\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> (10-, 5- \u0438 2,5-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BB%D0%BB%D0%B0%D1%80_%D0%A1%D0%A8%D0%90\" title=\"\u0414\u043e\u043b\u043b\u0430\u0440 \u0421\u0428\u0410\">\u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432\u044b\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE\" title=\"\u0417\u043e\u043b\u043e\u0442\u043e\">\u0437\u043e\u043b\u043e\u0442\u044b\u0445<\/a> \u043e\u0440\u043b\u043e\u0432, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u0435\u0440\u0435\u0431\u0440\u044f\u043d\u043e\u0433\u043e \u0434\u043e\u043b\u043b\u0430\u0440\u0430, \u043f\u043e\u043b\u0443\u0434\u043e\u043b\u043b\u0430\u0440\u0430, 25-, 10- \u0438 5-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82\" title=\"\u0426\u0435\u043d\u0442\">\u0446\u0435\u043d\u0442\u043e\u0432\u044b\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B5%D1%82%D0%B0\" title=\"\u041c\u043e\u043d\u0435\u0442\u0430\">\u043c\u043e\u043d\u0435\u0442<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794<\/a>&#160;\u2014 \u0412\u043e \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B2%D0%B5%D0%BD%D1%82\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0432\u0435\u043d\u0442\">\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u041a\u043e\u043d\u0432\u0435\u043d\u0442\u0430<\/a> \u043e \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0438 \u0432\u043e\u0438\u043d\u0441\u043a\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0445 \u0448\u0430\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1793_%D0%B3%D0%BE%D0%B4\" title=\"1793 \u0433\u043e\u0434\">1793<\/a> \u0433. \u0421\u043e\u0437\u0434\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f Aerostiers. \u0421\u043f\u0443\u0441\u0442\u044f \u0434\u0432\u0430 \u043c\u0435\u0441\u044f\u0446\u0430 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u0448\u0430\u0440 \u0441 \u043d\u0430\u0431\u043b\u044e\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0431\u044b\u043b \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d \u0432 \u0440\u0430\u0437\u0432\u0435\u0434\u044b\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0446\u0435\u043b\u044f\u0445. \u0414\u043e\u043d\u0435\u0441\u0435\u043d\u0438\u044f \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0445 \u043d\u0430\u0431\u043b\u044e\u0434\u0430\u0442\u0435\u043b\u0435\u0439 \u0441\u044b\u0433\u0440\u0430\u043b\u0438 \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u0443\u044e \u0440\u043e\u043b\u044c \u0432 \u0445\u043e\u0434\u0435 \u043c\u043d\u043e\u0433\u0438\u0445 \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u0445 \u0431\u0438\u0442\u0432 \u0438 \u043e\u0441\u0430\u0434 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438, \u043d\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799<\/a> \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u0431\u044b\u043b\u0430 \u0440\u0430\u0441\u043f\u0443\u0449\u0435\u043d\u0430.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1801_%D0%B3%D0%BE%D0%B4\" title=\"1801 \u0433\u043e\u0434\">1801<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BF%D0%B5%D0%BD%D0%B3%D0%B0%D0%B3%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u043e\u043f\u0435\u043d\u0433\u0430\u0433\u0435\u043d\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0420\u0430\u0437\u0433\u0440\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%82\" title=\"\u0424\u043b\u043e\u0442\">\u0444\u043b\u043e\u0442\u043e\u043c<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%BC%D0%B8%D1%80%D0%B0%D0%BB\" title=\"\u0410\u0434\u043c\u0438\u0440\u0430\u043b\">\u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BB%D1%8C%D1%81%D0%BE%D0%BD,_%D0%93%D0%BE%D1%80%D0%B0%D1%86%D0%B8%D0%BE\" title=\"\u041d\u0435\u043b\u044c\u0441\u043e\u043d, \u0413\u043e\u0440\u0430\u0446\u0438\u043e\">\u041d\u0435\u043b\u044c\u0441\u043e\u043d\u0430<\/a> \u0444\u043b\u043e\u0442\u0430 \u0421\u043e\u044e\u0437\u0430 \u0441\u0435\u0432\u0435\u0440\u043d\u044b\u0445 \u043c\u043e\u0440\u0441\u043a\u0438\u0445 \u0434\u0435\u0440\u0436\u0430\u0432 \u0432 \u0431\u0443\u0445\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BF%D0%B5%D0%BD%D0%B3%D0%B0%D0%B3%D0%B5%D0%BD\" title=\"\u041a\u043e\u043f\u0435\u043d\u0433\u0430\u0433\u0435\u043d\">\u041a\u043e\u043f\u0435\u043d\u0433\u0430\u0433\u0435\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810_%D0%B3%D0%BE%D0%B4\" title=\"1810 \u0433\u043e\u0434\">1810<\/a>&#160;\u2014 \u0411\u0440\u0430\u043a\u043e\u0441\u043e\u0447\u0435\u0442\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 I<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%80%D1%86%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3\" title=\"\u042d\u0440\u0446\u0433\u0435\u0440\u0446\u043e\u0433\">\u044d\u0440\u0446\u0433\u0435\u0440\u0446\u043e\u0433\u0438\u043d\u0435\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F-%D0%9B%D1%83%D0%B8%D0%B7%D0%B0_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u041c\u0430\u0440\u0438\u044f-\u041b\u0443\u0438\u0437\u0430 \u0410\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0430\u044f\">\u041c\u0430\u0440\u0438\u0435\u0439 \u041b\u0443\u0438\u0437\u043e\u0439<\/a>, \u0434\u043e\u0447\u0435\u0440\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u043e\u0433\u043e<\/a> \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86_II\" title=\"\u0424\u0440\u0430\u043d\u0446 II\">\u0424\u0440\u0430\u043d\u0446\u0430 II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1834_%D0%B3%D0%BE%D0%B4\" title=\"1834 \u0433\u043e\u0434\">1834<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u041e\u0431\u0432\u043e\u0434\u043d\u044b\u0439 \u043a\u0430\u043d\u0430\u043b\">\u041e\u0431\u0432\u043e\u0434\u043d\u043e\u043c \u043a\u0430\u043d\u0430\u043b\u0435<\/a> \u0432\u043e\u0437\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE-%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B0%D0%B2%D1%80%D0%B0\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e-\u041d\u0435\u0432\u0441\u043a\u0430\u044f \u043b\u0430\u0432\u0440\u0430\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e-\u041d\u0435\u0432\u0441\u043a\u043e\u0439 \u043b\u0430\u0432\u0440\u044b<\/a> \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B8%D0%BB%D0%BB%D0%B8%D0%BD%D0%B3,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0438\u043b\u043b\u0438\u043d\u0433, \u041f\u0430\u0432\u0435\u043b \u041b\u044c\u0432\u043e\u0432\u0438\u0447\">\u041f\u0430\u0432\u043b\u0430 \u0428\u0438\u043b\u043b\u0438\u043d\u0433\u0430<\/a> \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0451\u043d \u0432\u0437\u0440\u044b\u0432 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043c\u0438\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1836_%D0%B3%D0%BE%D0%B4\" title=\"1836 \u0433\u043e\u0434\">1836<\/a>&#160;\u2014 \u0421\u0432\u0430\u0434\u044c\u0431\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BA