9\u0441\u0442\u0432\u043e\u043c \u0432 1911 \u0433\u043e\u0434\u0443.<\/li><li>\u041f\u043e\u0441\u043b\u0435\u0434\u043d\u044f\u044f \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c \u0436\u0435\u043d\u0449\u0438\u043d\u044b-\u0443\u0431\u0438\u0439\u0446\u044b&#160;\u2014 \u0424\u0440\u0435\u043d\u0441\u0438\u0441 \u041a\u0438\u0434\u0434\u0435\u0440 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;Francis Kidder) (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a>).<\/li><\/ul><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1879_%D0%B3%D0%BE%D0%B4\" title=\"1879 \u0433\u043e\u0434\">1879<\/a>&#160;\u2014 \u041f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a>. \u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%BE%D0%B2%D1%8C%D1%91%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043e\u043b\u043e\u0432\u044c\u0451\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u043e\u043b\u043e\u0432\u044c\u0451\u0432<\/a> 5 \u0440\u0430\u0437 \u0432\u044b\u0441\u0442\u0440\u0435\u043b\u0438\u043b \u0432 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8C%D0%B2%D0%B5%D1%80\" title=\"\u0420\u0435\u0432\u043e\u043b\u044c\u0432\u0435\u0440\">\u0440\u0435\u0432\u043e\u043b\u044c\u0432\u0435\u0440\u0430<\/a>, \u043d\u043e \u043f\u0440\u043e\u043c\u0430\u0445\u043d\u0443\u043b\u0441\u044f.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%83%D1%8E_%D0%B4%D1%83%D0%BC%D1%83\" title=\"\u0412\u044b\u0431\u043e\u0440\u044b \u0432 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0443\u044e \u0434\u0443\u043c\u0443\">\u0412\u044b\u0431\u043e\u0440\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B4%D1%83%D0%BC%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8_I_%D1%81%D0%BE%D0%B7%D1%8B%D0%B2%D0%B0\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0434\u0443\u043c\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438 I \u0441\u043e\u0437\u044b\u0432\u0430\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0443\u044e \u0434\u0443\u043c\u0443 I \u0441\u043e\u0437\u044b\u0432\u0430<\/a> \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#