963<\/a>:<ul><li>\u0414\u043b\u044f \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f \u0438 \u043e\u0441\u0432\u043e\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u044b<\/a> \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0437\u0430\u043f\u0443\u0441\u043a \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0440\u0430\u043a\u0435\u0442\u044b \u0441 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u043e\u0439 \u0441\u0442\u0430\u043d\u0446\u0438\u0435\u0439 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0-4\" title=\"\u041b\u0443\u043d\u0430-4\">\u041b\u0443\u043d\u0430-4<\/a>\u00bb.<\/li><li>\u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B0%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%84%D0%BB%D0%BE%D1%82%D0%B0_(1963)\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 (1963)\">\u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0-10\" title=\"\u041b\u0443\u043d\u0430-10\">\u041b\u0443\u043d\u0430-10<\/a>\u00bb \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0432 \u043c\u0438\u0440\u0435 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u043e\u043c, \u043e\u0431\u043b\u0435\u0442\u0435\u0432\u0448\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%B2%D0%BE%D1%8F_(%D0%B3%D0%BC%D0%B8%D0%BD%D0%B0)\" title=\"\u0417\u0430\u0432\u043e\u044f (\u0433\u043c\u0438\u043d\u0430)\">\u0417\u0430\u0432\u043e\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0430<\/a>. \u0412\u044b\u043f\u043e\u043b\u043d\u044f\u044f \u0440\u0435\u0439\u0441 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0430\">\u0412\u0430\u0440\u0448\u0430\u0432\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D0%BA%D0%BE%D0%B2\" title=\"\u041a\u0440\u0430\u043a\u043e\u0432\">\u041a\u0440\u0430\u043a\u043e\u0432<\/a>, \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-24\" title=\"\u0410\u043d-24\">\u0410\u043d-24<\/a>\u0411 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 LOT Polish Airlines \u0432\u0440\u0435\u0437\u0430\u0435\u0442\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B1%D1%8C%D1%8F_(%D0%B3%D0%BE%D1%80%D0%B0)\" title=\"\u0411\u0430\u0431\u044c\u044f (\u0433\u043e\u0440\u0430)\">\u0433\u043e\u0440\u044b<\/a>. \u0412\u0441\u0435 53 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 \u043e\u0442\u043a\u043b\u043e\u043d\u0438\u043b\u0441\u044f \u043e\u0442 \u043d\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u0443\u0440\u0441\u0430 \u0432 \u0441\u0438\u043b\u044c\u043d\u043e\u043c \u0442\u0443\u043c\u0430\u043d\u0435 \u043f\u043e \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0439 \u043f\u0440\u0438\u0447\u0438\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1977_%D0%B3%D0%BE%D0%B4\" title=\"1977 \u0433\u043e\u0434\">1977<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-134_%D0%B2_%D0%9B%D0%B8%D0%B1%D1%80%D0%B5%D0%B2%D0%B8%D0%BB%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u0432 \u041b\u0438\u0431\u0440\u0435\u0432\u0438\u043b\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u0432 \u041b\u0438\u0431\u0440\u0435\u0432\u0438\u043b\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B1%D0%BE%D0%BD\" title=\"\u0413\u0430\u0431\u043e\u043d\">\u0413\u0430\u0431\u043e\u043d<\/a>). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 8 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c<\/a> \u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/CBS\" title=\"CBS\">CBS<\/a> \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u043e\u043a\u0430\u0437 \u0441\u0435\u0440\u0438\u0430\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BB%D0%BB%D0%B0%D1%81_(%D1%82%D0%B5%D0%BB%D0%B5%D1%81%D0%B5%D1%80%D0%B8%D0%B0%D0%BB)\" title=\"\u0414\u0430\u043b\u043b\u0430\u0441 (\u0442\u0435\u043b\u0435\u0441\u0435\u0440\u0438\u0430\u043b)\">\u0414\u0430\u043b\u043b\u0430\u0441<\/a>\u00bb. \u041f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u0430\u0432\u0442\u043e\u0440\u044b \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u043b\u0438 \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u043c\u0438\u043d\u0438-\u0441\u0435\u0440\u0438\u0430\u043b, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u043b \u0438\u0434\u0442\u0438 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043f\u044f\u0442\u0438 \u043d\u0435\u0434\u0435\u043b\u044c, \u043d\u043e \u0440\u0435\u0439\u0442\u0438\u043d\u0433 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0441\u0435\u043c\u044c\u0438 \u042e\u0438\u043d\u0433\u043e\u0432 \u043e\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043d\u0435\u043e\u0431\u044b\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u043e \u0432\u044b\u0441\u043e\u043a\u0438\u043c, \u0438 \u043f\u043e\u043a\u0430\u0437 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u0441\u044f 13 \u043b\u0435\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D0%BB%D0%BA%D0%BB%D0%B5%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0424\u043e\u043b\u043a\u043b\u0435\u043d\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0430\u043d\u0433\u043b\u043e-\u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0433\u043e \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\u0430<\/a> \u0438\u0437-\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D0%BB%D0%BA%D0%BB%D0%B5%D0%BD%D0%B4%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u0424\u043e\u043b\u043a\u043b\u0435\u043d\u0434\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u0424\u043e\u043b\u043a\u043b\u0435\u043d\u0434\u0441\u043a\u0438\u0445 (\u041c\u0430\u043b\u044c\u0432\u0438\u043d\u0441\u043a\u0438\u0445) \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432<\/a> (\u043f\u043e 14 \u0438\u044e\u043d\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u041e\u043a\u043e\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B8%D0%BD%D1%8B\" title=\"\u0410\u0444\u0438\u043d\u044b\">\u0410\u0444\u0438\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u044f<\/a>. \u0414\u0435\u0442\u043e\u043d\u0430\u0446\u0438\u044f \u0432\u0437\u0440\u044b\u0432\u043d\u043e\u0433\u043e \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430 \u0432 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u043c \u0441\u0430\u043b\u043e\u043d\u0435 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B8%D0%BD%D0%B3_727\" class=\"mw-redirect\" title=\"\u0411\u043e\u0438\u043d\u0433 727\">\u0411\u043e\u0438\u043d\u0433 727<\/a> \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Trans World Airlines \u0432\u044b\u0431\u0440\u04