B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u043d\u043e\u0432\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B5%D0%BD%D0%B4%D0%B0%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)\" title=\"\u041a\u043e\u043c\u0435\u043d\u0434\u0430\u043d\u0442\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0441\u043f\u0435\u043a\u0442 (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e)\">\u041a\u043e\u043c\u0435\u043d\u0434\u0430\u043d\u0442\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0441\u043f\u0435\u043a\u0442<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2011_%D0%B3%D0%BE%D0%B4\" title=\"2011 \u0433\u043e\u0434\">2011<\/a>&#160;\u2014 \u0432 \u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=Roswell_International_Air_Center&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Roswell International Air Center (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">Roswell International Air Center<\/a>  (\u0421\u0428\u0410) \u043f\u0440\u0438 \u0430\u0432\u0430\u0440\u0438\u0439\u043d\u043e\u0439 \u043f\u043e\u0441\u0430\u0434\u043a\u0435 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0443 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Gulfstream_G650\" title=\"Gulfstream G650\">Gulfstream G650<\/a>. \u041d\u0430 \u0431\u043e\u0440\u0442\u0443 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u043e\u0441\u044c \u0447\u0435\u0442\u0432\u0435\u0440\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a; \u0432\u0441\u0435 \u043e\u043d\u0438 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2012_%D0%B3%D0%BE%D0%B4\" title=\"2012 \u0433\u043e\u0434\">2012<\/a>&#160;\u2014 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8E%D0%BC%D0%B5%D0%BD%D1%8C\" title=\"\u0422\u044e\u043c\u0435\u043d\u044c\">\u0422\u044e\u043c\u0435\u043d\u044c\u044e<\/a> \u0440\u0430\u0437\u0431\u0438\u043b\u0441\u044f \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/ATR-72\" class=\"mw-redirect\" title=\"ATR-72\">ATR-72<\/a>, \u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%80%D0%B3%D1%83%D1%82\" title=\"\u0421\u0443\u0440\u0433\u0443\u0442\">\u0421\u0443\u0440\u0433\u0443\u0442<\/a>. \u041d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043b\u0430\u0439\u043d\u0435\u0440\u0430 \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/UTair\" class=\"mw-redirect\" title=\"UTair\">UTair<\/a> \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0438\u0441\u044c 39 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u0438 \u0447\u0435\u0442\u0432\u0435\u0440\u043e \u0447\u043b\u0435\u043d\u043e\u0432 \u044d\u043a\u0438\u043f\u0430\u0436\u0430. \u041f\u0440\u0438 \u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0438 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0432